        overflow: 'hidden',
    },

} */

export default ({addMessage, messages, channel, styles}) => {

    return (
        <main className="App-main" css={styles.main}>
            <Channel addMessage={addMessage} messages={messages} channel={channel}/>
            <Channels/>   
        </main>
    )
}
